    public function getSourceContext(): Source
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}Přihlášení{% endblock %}

{% block body %}
<div class=\"wrapper\">
    <form method=\"post\">
        {% if error %}
            <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
        {% endif %}

        {% if app.user %}
            <div class=\"mb-3\">
                Jste přihášen/a jako {{ app.user.userIdentifier }}, <a href=\"{{ path('app_logout') }}\">Odhlásit se</a>
            </div>
        {% endif %}

        <span class=\"h3 mb-3 font-weight-normal\">Přihlášení</span>
        <br>
        <label for=\"username\">Email</label>
        <input type=\"email\" value=\"{{ last_username }}\" name=\"_username\" id=\"username\" class=\"form-control\" autocomplete=\"email\" required autofocus>
        <label for=\"password\">Heslo</label>
        <input type=\"password\" name=\"_password\" id=\"password\" class=\"form-control\" autocomplete=\"current-password\" required>
        <input type=\"hidden\" name=\"_csrf_token\" value=\"{{ csrf_token('authenticate') }}\">

        <button class=\"btn btn-lg btn-primary mt-2\" type=\"submit\">
            Přihlásit se
        </button>
    </form>
</div>
{% endblock %}
", "security/login.html.twig", "C:\\Users\\adamp\\OneDrive\\Plocha\\rsp\\templates\\security\\login.html.twig");
